  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:10.438306\",\n\t\"name\": \"kirwin-national-wildlife-refuge-annual-narrative-report-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  National Wildlife Refuge summarizes refuge activities during the 1988 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered, fee title is included. The report includes a planning
  section which discusses master plans, management plans, and research and investigations.
  \ Refuge administration is outlined; information about personnel, volunteer programs,
  other manpower programs, funding, safety, technical assistance and other items is
  given.  Habitat management is also covered.  Subjects include wetlands, forests,
  croplands, grasslands, other habitats, grazing, haying, fire management, pest control,
  and wilderness and special areas.  The wildlife section of the report discusses
  wildlife diversity, endangered and/or threatened species, waterfowl, marsh and water
  birds, raptors, game mammals, other resident wildlife, fisheries resources, and
  scientific collections.  The public uses of the refuge described in this report
  include general, interpretive foot trails, interpretive tour routes, other interpretive
  programs, hunting, fishing, wildlife observation, other wildlife oriented recreation,
  camping, picnicking, off-road vehicling, other non-wildlife oriented recreation,
  and law enforcement.  The equipment and facilities section of the report provides
  information about new construction, rehabilitation, equipment utilization and replacement,
  communication systems, computer systems, energy conservation, and other.  Items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
